27 mars 2002 à Los Angeles (États-Unis).</p><p><br></p><p>Wilder excelle dans l’art du récit, mêlant cynisme, humour noir et sens aigu de la condition humaine. Son cinéma, souvent acerbe, interroge l’hypocrisie sociale, le désir, l’ambition et la faillibilité des individus. Il conjugue efficacité narrative, dialogues brillants et regard critique sur le rêve américain.</p>','https://fr.wikipedia.org/wiki/Billy_Wilder','https://www.imdb.com/fr/name/nm0000697/',1,'1906','2002','https://www.senscritique.com/top/resultats/les_meilleurs_films_de_billy_wilder/900918',NULL),(115,'John Wax','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(116,'Patrick Volson','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(117,'Michael Tuchner','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(118,'Roy William Neill','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(119,'John Rawlins','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(120,'Art Linson','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(121,'Nick Park','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(122,'Merlin Crossingham','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(123,'Artus','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(124,'Michael Apted','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(125,'Robert McKimson','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(126,'Friz Freleng','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(127,'Robert Clampett','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(128,'Walter Lantz','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(129,'Shamus Culhane','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(130,'Vernon Stallings','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(131,'Walt Disney','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(132,'Mark Hall','00_item_default.png',NULL,NULL,NULL,0