sateur, scénariste, producteur et acteur américain, né le 17 novembre 1942 à New York (États-Unis).</p><p><br></p><p>Scorsese développe un cinéma profondément ancré dans la culture américaine, en particulier celle de New York, marqué par la violence, la culpabilité, la foi, la rédemption et les contradictions morales de ses personnages. </p><p><br></p><p>Sa mise en scène nerveuse, son usage virtuose de la musique, du montage et du point de vue subjectif ont façonné un style immédiatement reconnaissable. À travers les milieux criminels, artistiques ou religieux, il scrute les obsessions humaines et la fabrication des mythes américains.</p>','https://fr.wikipedia.org/wiki/Martin_Scorsese','https://www.imdb.com/fr/name/nm0000217/',1,'1942',NULL,'https://www.senscritique.com/liste/filmographie_de_martin_scorsese/3208988',NULL),(378,'Michael Ritchie','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(379,'Paul Verhoeven','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(380,'Robert Thornby','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(381,'Bong Joon-ho','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(382,'Sam Liu','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(383,'Jake Castorena','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(384,'Jim Jarmusch','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(385,'Richard Lester','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(386,'Virginie Despentes','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(387,'Michael Mann','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(388,'Wim Wenders','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(389,'Juliano Ribeiro Salgado','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(390,'Hideo Gosha','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(391,'Pierre Trividic','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(392,'Patrick Mario B