 le drame psychologique, toujours avec une intensité sensorielle marquée.</p>','https://fr.wikipedia.org/wiki/William_Friedkin','https://www.imdb.com/fr/name/nm0001243/',1,'1935','2023','https://www.senscritique.com/top/resultats/les_meilleurs_films_de_william_friedkin/946450',NULL),(410,'Sébastien Marnier','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(411,'Tom Holland','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(412,'Jaume Balagueró','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(413,'Paco Plaza','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(414,'Tomas Alfredson','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(415,'E. Elias Merhige','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(416,'Terence Fisher','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(417,'Michel Gondry','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(418,'Ridley Scott','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(419,'Robert Aldrich','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(420,'Michael Cimino','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(421,'Jacques Audiard','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(422,'Robert Enrico','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(423,'Werner Herzog','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(424,'Roman Polanski','director-roman_Polanski-285e5e69-1697-4fed-b522-18ab47f76987.jpg','<p><strong>Roman Polanski</strong> est un réalisateur, scénariste, acteur et producteur franco-polonais, né le 18 août 1933 à Paris (France).</p><p><br></p><p>Son cinéma, souvent claustrophobe, scrute la paranoïa, la manipulation, la culpabilité et l’ambiguïté morale. </p><p><br></p><p>Polanski excelle dans l’art du suspense psychologique, où la mise en scène précise et la tension dramatique révèlent les fractures intérieures des personnages. </p><p><br></p><p>Ses films oscillent entre thriller, drame et comédie noire.</p>','https://fr.wikipedia.org/wiki/Roman_Polanski','https://www.imdb.com/fr/name/nm0000591/',1,'1933',NULL,NULL,NULL),(425,'Brian De Palma','director-54fc7df3-da05-408d-a3f6-a12859018d64.jpg','<p><strong>Brian De Palma</strong> est un réalisateur et scénariste américain, né le 11 septembre 1940 à Newark (États-Unis).</p><p><br></p><p>De Palma développe un cinéma fortement inspiré d’Hitchcock, mais poussé vers une stylisation baroque et une exploration ludique des dispositifs cinématographiques. Son œuvre mêle voyeurisme, manipulation, jeu avec les illusions optiques et virtuosité du découpage. Ses films oscillent entre thriller, horreur et satire, souvent marqués par une tension sexuelle et une violence opératique. </p><p><br></p><p>Il interroge la fabrication des images et la fragilité de la perception, faisant du cinéma lui-même son sujet central.</p>','https://fr.wikipedia.org/wiki/Brian_De_Palma','https://www.imdb.com/fr/name/nm0000361/',1,'1940',NULL,'https://www.senscritique.com/contact/brian_de_palma/2418',NULL),(426,'John Carpenter','director-john_carpenter-c520c45c-21e5-404b-b624-64f889da364e.jpg','<p><strong>John Carpenter</strong> est un réalisateur, scénariste, producteur, monteur, compositeur et acteur américain, né le 16 janvier 1948 à Carthage (États-Unis).</p><p><br></p><p>Carpenter développe un cinéma minimaliste, atmosphérique et profondément anxiogène. Il explore la peur, la paranoïa, l’assiègement et la dissolution sociale, avec une mise en scène épurée et une musique électronique hypnotique. Son univers oscille entre science-fiction, horreur et western moderne, toujours avec un sens aigu de la tension.</p>','https://fr.wikipedia.org/wiki/John_Carpenter','https://www.imdb.com/fr/name/nm0000118/',1,'1948',NULL,'https://www.senscritique.com/liste/realisateur_john_carpenter/48756',NULL),(427,'Damien Chazelle','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(428,'Steven Spielberg','director-a4556391-f532-4f41-ae2c-0845d8cba1de.jpg','<p><strong>Steven Spielberg</strong> est un réalisateur, scénariste et producteur américain, né le 18 décembre 1946 à Cincinnati, États-Unis.</p><p><br></p><p>Son cinéma conjugue sens du spectacle, empathie narrative et maîtrise du récit populaire. Spielberg explore avec la même aisance l’émerveillement de l’enfance, les drames historiques, la science-fiction et l’aventure. Sa mise en scène fluide, son art du mouvement et du regard, ainsi que son sens du rythme émotionnel, ont façonné l’imaginaire contemporain. </p><p><br></p><p>Il interroge la mémoire, la famille, la survie et l’héroïsme, tout en renouvelant constamment la grammaire visuelle du cinéma hollywoodien.</p>','https://fr.wikipedia.org/wiki/Steven_Spielberg','https://www.imdb.com/fr/name/nm0000229/',1,'1946',NULL,NULL,NULL),(429,'Alejandro Amenábar','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(430,'Philippe Harel','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(431,'Giuseppe Tornatore','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(432,'Claude Zidi','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(433,'Nicolas Giraud','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(434,'Maïwenn','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(435,'Richard Curtis','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(436,'Greta Gerwig','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(437,'David Lynch','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(438,'Yūsuke Watanabe','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(439,'Brett Leonard','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(440,'Leos Carax','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(441,'Peter Weir','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(442,'Don Sharp','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(443,'Renny Harlin','00_item_default.