 la violence, le pouvoir, la paranoïa et les dérives technologiques, souvent avec une ironie froide. </p><p><br></p><p>Chaque film devient ainsi une expérience sensorielle et intellectuelle, où l’image, le rythme et la musique composent un langage propre, rigoureux et énigmatique.</p>','https://fr.wikipedia.org/wiki/Stanley_Kubrick','https://www.imdb.com/fr/name/nm0000040/',1,'1928','1999',NULL,NULL),(673,'Luis Ortega','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(674,'Robert Wiene','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(675,'Jean-Michel Ribes','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(676,'Nobuhiko Obayashi','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(677,'Bill Plympton','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(678,'Jóhann Jóhannsson','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(679,'Karel Lamač','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(680,'Jean Vigo','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(681,'Nick Zedd','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(682,'Jon Vomit','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(683,'Dave Borthwick','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(684,'Clive A. Smith','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(685,'Václav Vorlíček','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(686,'Mario Caiano','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(687,'Christophe Honoré','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(688,'Konstantin Lopushansky','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(689,'Tony Scott','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(690,'Jiří Trnka','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(691,'Lee Tamahori','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(692,'Henri Verneuil','00_item_default.png',NULL,NULL