,0,NULL,NULL,NULL,NULL),(889,'Jacques Demy','director-jacques_demy-d670139a-e2c9-4f17-82ee-2b4c3b3b0dc2.jpg','<p><strong>Jacques Demy</strong> est un réalisateur, scénariste et compositeur français, né le 5 juin 1931 à Pontchâteau (France), et décédé le 27 octobre 1990 à Paris (France).</p><p><br></p><p>Son cinéma enchanteur mêle comédie musicale, romance, quotidien populaire et tragédie douce-amère. Demy crée des mondes colorés où le merveilleux affleure derrière le réalisme, tout en interrogeant le destin, l’amour, le hasard et les illusions. </p><p><br></p><p>Sa sensibilité musicale et visuelle compose un univers unique dans le cinéma français.</p>','https://fr.wikipedia.org/wiki/Jacques_Demy','https://www.imdb.com/fr/name/nm0218840/',1,'1931','1990','https://www.senscritique.com/top/resultats/les_meilleurs_films_de_jacques_demy/2303888',NULL),(890,'Dennis Hopper','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(891,'Gilles Grangier','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(892,'Arthur Lubin','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(893,'Harold Ramis','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(894,'Thierry Frémaux','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(895,'Raymond Rouleau','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(896,'Daniel Myrick','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(897,'Eduardo Sánchez','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(898,'Luis Buñuel','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(899,'Claude Bernard-Aubert','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(900,'Agnès Varda','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(901,'Yves Robert','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(902,'Éric Rohmer','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(903,'Julien Duvivier','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL)