 le western grâce à une stylisation extrême, un sens de l’épopée et une approche mythologique de l’Ouest américain. Leone mêle lenteur hypnotique, gros plans iconiques, violence opératique et musique expressive. </p><p><br></p><p>Il explore le destin, le temps, la vengeance et la légende, dans une dramaturgie puissante et mélancolique.</p>','https://fr.wikipedia.org/wiki/Sergio_Leone','https://www.imdb.com/fr/name/nm0001466/',1,'1929','1989','https://www.senscritique.com/top/resultats/les_meilleurs_films_de_sergio_leone/708756',NULL),(1455,'Deniz Gamze Ergüven','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1456,'Tonino Valerii','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1457,'Arnaud des Pallières','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1458,'Barry Shear','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1459,'Jean Aurel','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1460,'Justin Kurzel','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1461,'Ang Lee','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1462,'Gabriel Le Bomin','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1463,'Phil Alden Robinson','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1464,'László Nemes','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1465,'Antonin Baudry','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1466,'Nicole Garcia','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1467,'Thomas Kruithof','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1468,'Pierre Schoeller','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1469,'Rupert Goold','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1470,'Marco Bellocchio','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1471,'Vince Gilligan','00_item_default.png',NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1472,'Sean Ellis','00_item_default.png',NULL,