INSERT INTO `focus` VALUES (1,'Yakusas','<p><strong>Yakuzas — Le cinéma au cœur du crime et de l’honneur</strong></p><p><br></p><p>Les films de yakuzas plongent le spectateur dans un univers où loyauté, pouvoir et codes d’honneur dictent la vie et la mort. Ces récits explorent les conflits internes et les tensions d’un monde souterrain où chaque choix peut avoir des conséquences fatales.</p><p><br></p><p>Entre violence et discipline, trahison et fidélité, ces films montrent comment les personnages naviguent dans un système régi par des règles strictes, mêlant tradition, hiérarchie et morale propre à leur clan. Le huis clos des quartiers, des bars ou des arrière-salles devient le théâtre d’affrontements intenses et de dilemmes humains profonds.</p><p><br></p><p>Le cinéma de yakuzas mêle action, drame et psychologie, offrant une vision fascinante et souvent tragique de l’honneur et de la survie dans un monde où la loi n’est jamais celle de l’État, mais celle des hommes et de leurs engagements.</p>','focus-yakusas-48c0338a-1448-4c52-8cb2-28560b902673.jpeg',1),(2,'Chanbara','<p><strong>Chanbara — L’art du sabre au cinéma</strong></p><p><br></p><p>Le chanbara, ou cinéma de sabre japonais, met en scène l’honneur, la loyauté et le combat dans des récits où chaque geste compte. Plus qu’une simple action, le duel devient une chorégraphie précise, où l’esthétique se mêle à la tension dramatique.</p><p><br></p><p>Au cœur de ce genre, le héros ou l’anti-héros évolue dans un univers codifié, souvent marqué par des conflits de clans, des quêtes de justice ou des dilemmes moraux. Chaque affrontement révèle non seulement la virtuosité martiale, mais aussi les valeurs et les contradictions humaines.</p><p><br></p><p>Le chanbara transcende le spectacle pour devenir poésie en mouvement. Les sabres s’entrechoquent, les silences résonnent, et chaque plan transporte le spectateur dans un monde où l’honneur se mesure à l’acier, et où le cinéma fait vibrer le souffle des légendes.</p>','focus-chanbarra02-68c47f8a-40d9-4ad5-aec4-fda9028be2db.jpeg',1),(3,'Wu Xia Pian','<p><strong>Wu Xia Pian — L’art martial à l’écran</strong></p><p><br></p><p>Le Wu Xia Pian plonge le spectateur dans un monde où l’honneur, la vengeance et la maîtrise du corps se mêlent à l’esthétique du mouvement. </p><p><br></p><p>Ici, les combats ne sont pas seulement physiques : ils sont chorégraphiés comme de véritables danses, où chaque saut, chaque geste raconte une histoire.</p><p><br></p><p>Ces récits ancrés dans l’histoire et les légendes chinoises explorent des codes moraux stricts et des valeurs telles que la loyauté, la justice et la quête de soi. Le héros, au-delà de ses prouesses martiales, incarne un idéal qui dépasse le combat : discipline, courage et sagesse.</p><p><br></p><p>Au cinéma, le Wu Xia Pian transforme l’action en poésie visuelle. Les paysages deviennent scène, les arts martiaux deviennent langage, et chaque affrontement révèle la beauté et la profondeur d’un monde où le mouvement est à la fois spectacle et philosophie.</p>','focus-wu_xa_pian-8ff76071-9327-4fd9-b422-714ae26a2488.jpeg',1),(4,'Blaxploitation','<p><strong>Blaxploitation — Le cinéma en colère et en rythme</strong></p><p><br></p><p>Née dans les années 1970 aux États-Unis, la Blaxploitation a donné la parole à des héros et héroïnes noirs dans un cinéma populaire qui mêle action, musique et engagement social. Ces films, souvent construits autour de personnages puissants et charismatiques, explorent la résistance, la dignité et l’affirmation d’une identité face aux injustices.</p><p><br></p><p>Au-delà du style flamboyant et des bandes-son funk ou soul inoubliables, la Blaxploitation met en scène des histoires de pouvoir, de vengeance et de survie dans des environnements urbains et parfois violents. Les personnages, qu’ils soient justiciers ou anti-héros, incarnent la confrontation à un monde qui cherche à les limiter, tout en affirmant leur liberté et leur audace.</p><p><br></p><p>Le genre célèbre la culture afro-américaine et son énergie créative, transformant le cinéma en manifeste visuel, musical et politique. Entre rythme, style et engagement, la Blaxploitation reste une fenêtre unique sur une époque et une culture.</p>','focus-blackploitation-c9174ffb-a916-484c-b999-823d90a9ef8b.jpeg',1),(5,'Les Oscars','<p><strong>Oscar du Meilleur Film – Academy Awards</strong></p><p><br></p><p>L’Oscar du Meilleur Film&nbsp;est sans doute la distinction cinématographique la plus célèbre au monde.</p><p><br></p><p>Décerné par l’Academy of Motion Picture Arts and Sciences, il récompense le film considéré comme le plus accompli de l’année parmi les productions internationales diffusées aux États-Unis. </p><p><br></p><p>Véritable événement mondial depuis 1929, les Oscars mettent en lumière des œuvres qui allient excellence artistique, puissance narrative et impact culturel. </p><p><br></p><p>Obtenir l’Oscar du Meilleur Film, c’est entrer dans la légende d’Hollywood et inscrire son nom dans l’histoire du cinéma.</p>','focus-ocar-b5912cda-936d-4364-8498-6552d7a80927.jpg',2),(6,'La Palme d\'Or','<p><strong>La Palme d’Or du Festival de Cannes</strong></p><p><br></p><p>Symbole ultime de prestige cinématographique, la Palme d’Or couronne chaque année le film jugé le plus marquant de la sélection officielle du Festival de Cannes. </p><p><br></p><p>Créée en 1955, elle incarne l’esprit d’audace, d’innovation et d’exigence artistique qui fait la renommée du festival. Décernée par un jury international composé de personnalités du cinéma, la Palme d’Or distingue des œuvres souvent engagées, poétiques ou radicales, qui marquent durablement l’histoire du septième art.</p><p><br></p><p>Recevoir la Palme d’Or, c’est accéder à un cercle très restreint de films dont l’impact dépasse largement les frontières du festival.  Pour de nombreux cinéastes, cette récompense représente non seulement une reconnaissance exceptionnelle, mais aussi une invitation à continuer de repousser les limites du langage cinématographique.</p><p><br></p><p>Au fil des décennies, la Palme d’Or est devenue bien plus qu’un trophée : un véritable repère pour les cinéphiles du monde entier, une célébration du cinéma dans toute sa diversité et son pouvoir de transformation.</p>','focus-palme_d_or_cannes-6ee8f16a-a512-4bd6-83f0-3110a926ce05.jpg',2),(7,'Les Césars','<p><strong>César du Meilleur Film – Académie des Arts et Techniques du Cinéma</strong></p><p><br></p><p>Le&nbsp;César du Meilleur Film&nbsp;est la récompense la plus prestigieuse du cinéma français. </p><p><br></p><p>Remis chaque année par l’Académie des Arts et Techniques du Cinéma, il célèbre les œuvres qui se distinguent par leur écriture, leur mise en scène, leurs performances et leur singularité. Depuis 1976, les Césars honorent la richesse et la diversité du cinéma francophone. </p><p><br></p><p>Obtenir le César du Meilleur Film, c’est bénéficier d’une reconnaissance institutionnelle majeure et rejoindre les grands titres qui ont marqué la culture cinématographique française.</p>','focus-cesar-d62bd25a-edf2-4fb5-834d-616c3d6be626.jpg',2),(8,'Avoriaz-Gerardmer','<p><strong>Festival d’Avoriaz / Festival de Gérardmer – Prix du Film Fantastique</strong></p><p><br></p><p>Longtemps référence absolue pour le cinéma fantastique, le&nbsp;<strong>Festival d’Avoriaz</strong>&nbsp;(1973–1993) a marqué des générations de cinéphiles en révélant des œuvres devenues cultes. </p><p><br></p><p>Après sa disparition, son héritage a été repris par le&nbsp;<strong>Festival International du Film Fantastique de Gérardmer</strong>, créé en 1994 et toujours actif aujourd’hui.</p><p><br></p><p>Ce festival met à l’honneur les films d’horreur, de science-fiction, de fantasy ou encore les thrillers surnaturels. Le&nbsp;<strong>Grand Prix</strong>&nbsp;de Gérardmer récompense des œuvres audacieuses, souvent issues de cinématographies innovantes, qui repoussent les limites du genre.</p><p><br></p><p>Devenu un rendez-vous incontournable pour les amateurs de fantastique, le festival perpétue l’esprit d’Avoriaz : célébrer l’imaginaire, bousculer les codes et offrir une place de choix aux visions les plus originales du cinéma mondial.</p>','focus-avoriaz-geradmer-37370f07-e7c2-4b80-8c26-684fa7d9bb3b.jpg',2),(9,'Les Baftas','<p><strong>BAFTA du Meilleur Film</strong></p><p><br></p><p>Le&nbsp;BAFTA du Meilleur Film&nbsp;est la plus haute distinction remise par la&nbsp;British Academy of Film and Television Arts. </p><p><br></p><p>Considéré comme l’équivalent britannique des Oscars, il récompense un film pour son excellence artistique, sa narration et sa capacité à toucher un large public. </p><p><br></p><p>Les BAFTA, connus pour leur exigence et leur élégance, mettent en avant autant le cinéma britannique que les productions internationales majeures. Recevoir ce prix, c’est être reconnu pour une œuvre complète, raffinée et marquante.</p>','focus-bafta-c819398f-c140-4bdf-9478-65c4768705cc.jpg',2),(10,'Le Lion D\'or','<p><strong>Lion d’Or – Mostra de Venise</strong></p><p><br></p><p>Récompense suprême de la&nbsp;<strong>Mostra de Venise</strong>, le plus ancien festival de cinéma du monde, le&nbsp;<strong>Lion d’Or</strong>&nbsp;distingue chaque année un film d’exception pour son audace, sa maîtrise artistique ou sa vision singulière. </p><p><br></p><p>Créé en 1949, il s’est imposé comme l’un des trophées les plus respectés du cinéma international. Souvent associé à des œuvres ambitieuses et profondément humaines, le Lion d’Or consacre des réalisateurs qui marquent leur époque. </p><p><br></p><p>Cette récompense est aujourd’hui un symbole de liberté créative et de raffinement cinématographique, faisant de Venise un lieu incontournable pour les passionnés du septième art.</p>','focus-Mostra_venise-38064cfd-77e4-4368-bebd-92c395a1ddef.jpg',2),(11,'L\'Ours d\'Or','<p><strong>Ours d’Or – Berlinale</strong></p><p><br></p><p>Décerné au cœur de l’hiver berlinois, l’<strong>Ours d’Or</strong>&nbsp;est le prix le plus prestigieux du&nbsp;<strong>Festival International du Film de Berlin</strong>. </p><p><br></p><p>Depuis 1951, il distingue des films engagés, souvent ancrés dans les réalités sociales et politiques de leur temps. La Berlinale se caractérise par sa sensibilité humaniste et son ouverture aux voix nouvelles du cinéma mondial. </p><p><br></p><p>Ce prix est devenu un repère pour découvrir des œuvres audacieuses, parfois radicales, toujours profondément ancrées dans le présent.</p>','focus-19e051d6-0f16-43d5-b6a1-5f09ec6c7714.jpg',2),(12,'Heroic Fantasy','<p><strong>Thématique : Heroic Fantasy — Le cinéma au royaume de l’imaginaire</strong></p><p><br></p><p>L’heroic fantasy plonge le spectateur dans des mondes où l’imaginaire et l’aventure règnent en maîtres. Châteaux, forêts enchantées, montagnes inexplorées ou terres magiques deviennent autant de terrains pour des quêtes épiques, des combats épiques et des rencontres avec des créatures extraordinaires.</p><p><br></p><p>Les héros, qu’ils soient guerriers, magiciens ou simples voyageurs, incarnent l’espoir et la résistance face à des forces plus grandes qu’eux.</p><p><br></p><p>Au cinéma, l’heroic fantasy transforme l’aventure en spectacle visuel et narratif, mêlant imagination, émotion et évasion. Chaque décor, chaque geste et chaque combat devient une invitation à explorer des mondes où tout semble possible.</p>','focus-heroic_fantasy_500px-5276bd15-56a0-4d7c-8f24-090437dd5f86.jpg',1),(13,'Cognac','<p><strong>Festival du Film Policier de Cognac – Le rendez-vous du polar à l’écran</strong></p><p><br></p><p>Le Festival du Film Policier de Cognac, créé en 1982, a longtemps été l’un des grands rendez-vous français dédiés au cinéma policier. </p><p><br></p><p>Pendant près de vingt-cinq ans, il a célébré le polar sous toutes ses formes : enquêtes, thrillers, films noirs, suspense et fictions criminelles. Le festival a accueilli de nombreux acteurs, réalisateurs et auteurs emblématiques du genre, devenant un point de rencontre incontournable pour les amateurs d’intrigues et d’adrénaline.</p><p><br></p><p>Même s’il n’existe plus aujourd’hui, Cognac reste associé à cet héritage unique qui a marqué l’histoire du polar en France.</p>','focus-cognac-aa40e9e7-b7d5-4910-8752-9ca6f5b8923f.jpg',2),(14,'En mer','','focus-ae2ce9f0-e8ce-4354-9d77-dfbc620642dd.jpg',1);
